import React, { useState,useEffect } from 'react';
import "../App.css";
import products from "../products.json";
function Products()
{

    const [items, setItems] = useState([]);

  useEffect(() => {
    setItems(products);
  }, []);

  const deleteItem = (id) => {
    const newItems = items.filter((item) => item.id !== id);
    setItems(newItems);
  };

    return(
        
        <div>
             
 <div class="header_design">

<img src={logo} class="he1"/>
<font class="he2" color="blue">Dashboard</font>
<font class="he3" color="black">Products</font>
<font class="he4" color="black">Orders</font>










</div>
            
<h1>Products </h1>

<table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Quantity</th>
          </tr>
        </thead>
        <tbody>
          {items.map(item => (
            <tr key={item.id}>
              <td>{item.id}</td>
              <td>{item.name}</td>
              <td>{item.quantity}</td>
            </tr>
          ))}
        </tbody>
      </table>
        </div>
    )
}

export default Products;




